import React, { Component } from 'react';
import {
    Container,
    Header,
    Image,
    Grid,
    Segment
} from 'semantic-ui-react';
import './index.css';
import productImage from "../../public/images/dzvun.jpg";

class ProductsDropdown extends Component {

    constructor() {
        super();
        this.state = {};
    }
    render() {
        return (
            <Container>
                <Header>
                    FAQ
                </Header>
                <Header>
                    Guides
                </Header>
                <Header>
                    Contact Us
                </Header>
            </Container>
        )
    }
}

export default ProductsDropdown;
